  const fetchData = async ()=>{
    const { data } = await axios.get('/app/products');
    setProduct(data);
  }
  useEffect(()=>{
    fetchData()
  },[])
  console.log(product);
  return <>
    {product[1].id}
  </>
}

export default Home
